import axios from 'axios';

const API_URL = 'https://pqfmihie7ty5jnwkuoa6vozsom0vqffo.lambda-url.us-east-2.on.aws';

export const fetchOrders = async () => {
  try {
    const shopUrl = 'martin-clinic-2.myshopify.com';
    const accessToken = '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';

    const response = await axios.get(`${API_URL}?shopUrl=${shopUrl}&accessToken=${accessToken}`);
    return response.data;
  } catch (error) {
    console.error("Error fetching orders:", error.message);
    throw error;
  }
};
